import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faTwitter,
  faFacebook,
  faInstagram,
} from "@fortawesome/free-brands-svg-icons";
import {FooterWrapper, Copyright, LinkWrapper, SocialMediaTitle, SocialMediaWrapper, Link} from '../../StyledComponents/footerItems';

const Footer = (props) => {
  return (
    <FooterWrapper>
      <SocialMediaTitle>Siga-nos</SocialMediaTitle>
      <SocialMediaWrapper>
        <LinkWrapper>
        </LinkWrapper>
        <LinkWrapper>
        <FontAwesomeIcon icon={faFacebook} size="2x" />
        </LinkWrapper>
        <LinkWrapper>
        <FontAwesomeIcon icon={faInstagram} size="2x" />
        </LinkWrapper>
      </SocialMediaWrapper>
      <Copyright>&copy;2020 OrganaFood</Copyright>
    </FooterWrapper>
  );
};

export default Footer;
